import React, { Component } from "react";
import logo from "./logo.svg";
import "./App.css";
import ToDoForm from "./pages/todo-form/todo-form";
class App extends Component {
  constructor() {
    super();
    this.state = {
      firstName: "",
      lastName: "",
      email: "",
      subject: "",
      message: "",
      result: "",
    };
  }
  render() {
    return (
      <div className="App">
        <ToDoForm />
      </div>
    );
  }
}

export default App;
